import React from 'react';
import { Document, Page } from 'react-pdf';

function Resume() {

  function onDocumentLoadSuccess({ numPages }) {}
  return (
    <div>
      <Document
        file="./../components/resume.pdf"
        onLoadSuccess={onDocumentLoadSuccess}
      >
        <Page pageNumber={1} />
      </Document>
    </div>
  );
}

export default Resume;
